int is_prime(int n) {
    if (n <= 1) return 0; // Отрицательные числа и 0 не являются простыми
    for (int i = 2; i * i <= n; i++) {
        if (n % i == 0) return 0; // Если n делится без остатка на i, то n не простое
    }
    return 1; // Если прошли проверку, то число простое
}

int main() {
    // Открываем файл для записи результатов
    FILE *file = fopen("results.txt", "w");
    if (file == NULL) {
        perror("fopen");
        exit(EXIT_FAILURE);
    }

    // Читаем число из pipe, переданное родительским процессом
    int number;
    scanf("%d", &number);

    // Проверяем число на простоту
    if (is_prime(number)) {
        printf("%d простое.\n", number);
    } else {
        printf("%d составное. Записываем в файл.\n", number);
        fprintf(file, "%d\n", number);
    }

    // Закрываем файл
    fclose(file);

    return 0;
}

