class NavisionServiceAttributes(ABC):
    def __init__(
            self,
            parameters: Optional[dict] = None,
            connection_service: NavisionConnectionService = NavisionConnectionService,
            query_service: NavisionQueryService = NavisionQueryService(),
    ) -> None:
        self.parameters = parameters
        self.connection_service = connection_service
        self.query_service = query_service

    @property
    @abstractmethod
    def commit(self) -> bool:
        pass

    @property
    @abstractmethod
    def query_type(self) -> QueryType:
        pass

    @property
    @abstractmethod
    def procedure_name(self) -> str:
        pass


class BaseNavisionService(NavisionServiceAttributes, ABC):
    """Base class for Navision services."""
    @property
    def _sql_text(self) -> str:
        if not self.parameters:
            return self.procedure_name

        parameters_str = ', '.join([f'@{k} = {v}' for k, v in self.parameters.items()])
        return f'{self.procedure_name} {parameters_str}'

    def _prepare_request(self) -> NavRequest:
        return NavRequest(
            query_type=self.query_type,
            sql_text=self._sql_text,
            commit=self.commit,
        )

    def _prepare_response(
            self,
            query_result: Optional[list[dict]] = None,
            errors: Optional[list[str]] = None
    ) -> NavOperationResult:
        return NavOperationResult(
            is_succeed=True if not errors else False,
            records=query_result,
            errors=errors,
        )

    def execute(self) -> NavOperationResult:
        request = self._prepare_request()
        try:
            result = self.query_service.make_query(request)
        except Exception as e:
            return self._prepare_response(errors=[e.args[1]])
        else:
            return self._prepare_response(query_result=result)


