    static boolean isNumeric(String txtIn) {
        boolean isNumber = true;
        if (txtIn.trim().isEmpty()) {
            isNumber = false;
        }
        try {
            double d = Double.parseDouble(txtIn);
        } catch (Exception e) {
            isNumber = false;
        }
        return isNumber;
    }
    
    static double compute(double num1, double num2, String op){
        double result;
        switch (op) {
            case "+" : 
                result = num1 + num2;
                break;
            case "-" : 
                result = num1 - num2;
                break;
            case "*" : 
                result = num1 * num2;
                break;
            case "/" : 
                if (num2 > 0) {
                    result = num1 / num2;
                } else {
