        super(TBlockEntities.TRAFFIC_SIGNAL_BE.get(), bp, bs);
    }

    @Override
    public void load(CompoundTag lct) {
        super.load(lct);
        this.items = NonNullList.withSize(this.getContainerSize(), ItemStack.EMPTY);
        if (!this.tryLoadLootTable(lct)){
            ContainerHelper.loadAllItems(lct,this.items);
        }

        this.isHorizontal = lct.getBoolean("horizontal");
        this.lightCount = lct.getInt("light_count");

        String[] bulb0data = lct.getString("bulb" + 0).split("H");
        String[] bulb1data = lct.getString("bulb" + 1).split("H");
        String[] bulb2data = lct.getString("bulb" + 2).split("H");

        /*
        0, isNormalBulb +
        1, isArrowBulb +
        2, colorID +
        3, flash +
        4, arrow;
        */

        // boolean normal, boolean arr, int clrid, boolean fls, int arrty
        Logger.getAnonymousLogger().info("We are getting data for " + getBlockPos() + Arrays.toString(bulb0data));

        boolean a = Boolean.parseBoolean(bulb0data[0]);
        boolean b = Boolean.parseBoolean(bulb0data[1]);
        int c = Integer.parseInt(bulb0data[2]);
        boolean d = Boolean.parseBoolean(bulb0data[3]);
        int e = Integer.parseInt(bulb0data[4]);

        this.bulbs[0] = new Bulb(a,b,c,d,e);

        Logger.getAnonymousLogger().info("Data for bulbs " + 0 + " is " + this.bulbs[0].toString());

        Logger.getAnonymousLogger().info("We are getting data for " + getBlockPos() + Arrays.toString(bulb1data));

        a = Boolean.parseBoolean(bulb1data[0]);
        b = Boolean.parseBoolean(bulb1data[1]);
        c = Integer.parseInt(bulb1data[2]);
        d = Boolean.parseBoolean(bulb1data[3]);
        e = Integer.parseInt(bulb1data[4]);

        this.bulbs[1] = new Bulb(a,b,c,d,e);

        Logger.getAnonymousLogger().info("Data for bulbs " + 1 + " is " + this.bulbs[1].toString());

        Logger.getAnonymousLogger().info("We are getting data for " + getBlockPos() + Arrays.toString(bulb2data));

        a = Boolean.parseBoolean(bulb2data[0]);
        b = Boolean.parseBoolean(bulb2data[1]);
        c = Integer.parseInt(bulb2data[2]);
        d = Boolean.parseBoolean(bulb2data[3]);
        e = Integer.parseInt(bulb2data[4]);

        this.bulbs[2] = new Bulb(a,b,c,d,e);

        Logger.getAnonymousLogger().info("Data for bulbs " + 2 + " is " + this.bulbs[2].toString());

        signalUpdate();
    }

    @Override
    protected void saveAdditional(CompoundTag sct) {
        super.saveAdditional(sct);

        if (!this.trySaveLootTable(sct)){
            ContainerHelper.saveAllItems(sct,this.items);
        }

        sct.putInt("light_count",this.lightCount);
        sct.putBoolean("horizontal",this.isHorizontal);

        for(int i = 0; i < bulbs.length; i++){
            if(bulbs[i] != null){
                sct.putString("bulb" + i, bulbs[i].convertToString());
            }
        }
    }

