        this.items = nnlis;
    }

    @Override
    public void setRemoved() {
        super.setRemoved();
    }
    @Override
    public void clearRemoved() {
        super.clearRemoved();
    }

    /**
     * Set the traffic signal's indicator state by ID
     * Be specific and specify which light to update!
     * The ids are: 0 - green, 1 - yellow, 2 - red
     * The value of these states can be either true or false
     * @param bulbID the bulb id to change the color of (must be in the range of the size of the bulbs Array, usually 3, so 0-2)
     * @param colorToChangeTo The color to change to (red -> 2, yellow -> 1, and green -> 0)
     */
    public void setColorForBulb(int bulbID, int colorToChangeTo){
        int bulbsTooFar = bulbs.length + 1;

        if(bulbs.length != 0 && bulbID < bulbsTooFar){
            bulbs[bulbID].setColorID(colorToChangeTo);
            signalUpdate();
        }
    }

    /**
     * Sets the arrow type to use for a given arrow bulb
     * @param bulbID The bulb's id to change arrow type for (must be in the range of the size of the bulbs Array, usually 3, so 0-2)
     * @param at The arrow type to change the given bulb id to (left -> 3, right -> 2, up -> 1, down -> 0)
     */
    public void setArrowType(int bulbID, int at){
        int bulbsTooFar = bulbs.length + 1;

        if(bulbs.length != 0 && bulbID < bulbsTooFar){
            bulbs[bulbID].setArrow(at);
            signalUpdate();
        }
    }

    @Override
